                style={{
                  padding: '8px 16px',
                  backgroundColor: '#3f51b5',
                  color: 'white',
                  border: 'none',
                  borderRadius: '4px',
                  cursor: 'pointer',
                  fontSize: '16px',
                }}
              >
                生成优化策略
              </button>
            )}
          </Paper>
        </Grid>
      </Grid>

      {error && (
        <Alert severity="error" sx={{ mb: 3 }}>
          {error}
        </Alert>
      )}

      {strategies.length > 0 && (
        <Grid container spacing={3}>
          <Grid item xs={12}>
            <Paper sx={{ p: 2 }}>
              <Typography variant="h6" gutterBottom>
                储能优化趋势
              </Typography>
              <Box sx={{ height: 400 }}>
                <Line data={prepareChartData()} options={chartOptions} />
              </Box>
            </Paper>
          </Grid>

          <Grid item xs={12}>
            <Paper sx={{ p: 2 }}>
              <Typography variant="h6" gutterBottom>
                推荐策略列表
              </Typography>
              <Divider sx={{ mb: 2 }} />
              <Box sx={{ maxHeight: 400, overflowY: 'auto' }}>
                {strategies
                  .filter((s) => s.strategy !== 'maintenance')
                  .sort((a, b) => b.priority - a.priority)
                  .map((strategy, index) => (
                    <Card
                      key={index}
                      sx={{ mb: 2, borderLeft: `4px solid ${getPriorityColor(strategy.priority)}` }}
                    >
                      <CardContent>
                        <Grid container spacing={2} alignItems="center">
                          <Grid item xs={12} md={2}>
                            <Typography variant="subtitle2">
                              {new Date(strategy.timestamp).toLocaleString()}
                            </Typography>
                          </Grid>
                          <Grid item xs={12} md={2}>
                            <Typography
                              variant="body1"
                              sx={{
                                fontWeight: 'bold',
                                color: getPriorityColor(strategy.priority),
                              }}
                            >
                              {strategy.strategy === 'charge' && '充电'}
                              {strategy.strategy === 'discharge' && '放电'}
                              {strategy.strategy === 'stop_charge' && '停止充电'}
                              {strategy.strategy === 'stop_discharge' && '停止放电'}
                            </Typography>
                          </Grid>
                          <Grid item xs={12} md={4}>
